import React from 'react'
import './Post.css';
import Avatar from "@material-ui/core/Avatar";

function Post() {
    return (
    <div className="post">
          
          <div className="post_header">
            
             <Avatar
             className="post_avatar"
             alt="AmanKumar"
             source="/static/images/avatar/1.png"
             />
             <h3>Username</h3>
        
        </div>
             {/* header -> avatar + username*/}

        
            <img className="post_image" alt="" src="https://images.unsplash.com/photo-1433086966358-54859d0ed716?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60"></img>
                {/* image */}
             <h4 className="post_text"><strong>AMAN</strong>Using reactjs</h4>
             {/* username + caption */}
           
    </div>
 
    )
}

export default Post
